[General]
network = FogSequentialForward
#cpu-time-limit = 60s
cmdenv-config-name = FogBase
tkenv-default-config = FogBase
qtenv-default-config = FogBase
repeat = 5
sim-time-limit = 10800s
#debug-on-errors = true
# parameters of the simulation
[Config FogBase]
description = "Global scenario"
# FIXME: should be nSources = 100
FogSequentialForward.nSources = 5
# FIXME: should be rho = [0.2, 0.5, 0.8, 0.9]
FogSequentialForward.rho = 0.9
# FIXME: should be proctimeMul = [1.0, 0.01]
FogSequentialForward.proctimeMul = 1.0
#FogSequentialForward.source[*].sendInterval = exponential(2s)
#FogSequentialForward.source[*].suggestedTime = normal(1.67s, 0.036s)
FogSequentialForward.source[*].appId = 1
#FogSequentialForward.source[*].SLAmult = 10
FogSequentialForward.source[*].realTime = true     
FogSequentialForward.source[*].multiHop = true    
#FogSequentialForward.source[*].maxInterval = -1s
FogSequentialForward.fog[*].nServers = 1
FogSequentialForward.fog[*].dispatcher.fanOut = 1
FogSequentialForward.fog[*].server[*].timeSlice = -1s
FogSequentialForward.fog[*].server[*].timeout = -1s
FogSequentialForward.fog[*].server[*].capacity = 20
FogSequentialForward.fog[*].server[*].fifo = true
FogSequentialForward.fog[*].server[*].maxServiceTime = -1s
FogSequentialForward.fog[*].dispatcher.thr = 1

[Config Fog-mul_001-rho_02-thr_1]
